css:
.sheet-toolbar {
  border-bottom: 1px solid #2c2c2c;
  box-shadow: none;
}
.thread-icon:not(.thread-icon-unread):not(.thread-icon-star) {
  filter: invert(100%);
}
img.content-dark {
  filter: invert(100%);
}
img.content-light {
  filter: invert(100%);
}
.mail-label {
  filter: contrast(110%) brightness(85%);
}
#message-list .message-item-wrap .message-item-white-wrap {
  box-shadow: 0 0 0.5px rgba(255, 255, 255, 0.28), 0 1px 1.5px rgba(255, 255, 255, 0.08);
}
.thread-list .list-item:not(.unread):not(.selected):not(.focused) {
  color: #aaa;
}
.thread-list .list-item.thread-list-reminder-item {
  background-color: #312856;
}
.thread-list .list-item.thread-list-reminder-item.unread {
  background-color: #312856;
}
.thread-list .list-item.thread-list-reminder-item.unread:not(.focused):not(.selected) {
  background-color: #312856;
}
.send-reminders-header {
  color: #7d5bef;
  background: #312856;
  border-bottom: 1px solid #4d3b8a;
}
.selected-items-stack {
  display: flex;
  align-self: center;
  align-items: center;
  height: 100%;
}
.selected-items-stack .selected-items-stack-content {
  display: flex;
  position: relative;
  align-items: center;
  justify-content: center;
  width: 198px;
  height: 268px;
}
.selected-items-stack .selected-items-stack-content .stack .card {
  position: absolute;
  top: 0;
  left: 0;
  width: 198px;
  height: 268px;
}
.selected-items-stack .selected-items-stack-content .stack .card svg {
  stroke: #2c2c2c;
  fill: #212121;
}
.selected-items-stack .selected-items-stack-content .count-info {
  display: flex;
  flex-direction: column;
  align-items: center;
  z-index: 6;
}
.selected-items-stack .selected-items-stack-content .count-info .count {
  font-size: 4em;
  font-weight: 200;
  color: rgba(238, 238, 238, 0.6);
}
.selected-items-stack .selected-items-stack-content .count-info .count-message {
  padding-top: 5px;
  color: rgba(238, 238, 238, 0.6);
}
.selected-items-stack .selected-items-stack-content .count-info .clear.btn {
  margin-top: 18px;
}
